import React, { Component } from 'react';

class CompA extends Component {
    state = {
        name: 'Comp A'
    }
    updateNameState = () => {
        this.setState({
            name: 'Comp A2'
        })
    }
    render() {
        return ( <
            div >
            Comp A <
            button onClick = { this.updateNameState } > Update Name < /button> <
            /div>
        );
    }
}

export default CompA;
